import streamlit as st
st.title("原神启动")
st.header("我要玩原神")
st.subheader("不玩原神你会度过一个相对失败的人生")
st.text("我宣布个事")

st.markdown("这是我老婆: \n \
            ![](data:image/jpeg;base64,)")

if st.checkbox("Show/Hide"):
    st.text("原来你也玩原神")


status = st.radio("选择主角:" ,
                  ('哥哥',
                   '妹妹'))
if status == '哥哥':
    st.success("空")
else:
    st.success("莹")
            
hobbies = st.multiselect("xp:",  
                         ['神里绫华',  
                          '宵宫',  
                          '纳西妲',  
                          '大伟哥'])
if '神里绫华' in hobbies:  
    st.success("我是神里绫华的狗")  
elif '宵宫' in hobbies:  
    st.success("有品")  
elif '纳西妲' in hobbies:  
    st.success("变态")  
else:
    if hobbies:
        st.success("牛逼")  
    else:    
        st.success("选择你的xp") 
    

if st.button("下载原神"):
    st.markdown("[点击这里下载原神](https://ys-api.mihoyo.com/event/download_porter/link/ys_cn/official/pc_backup53)") 

name = st.text_input("是真的下载")

level = st.slider("给原神评分", 1, 5) 
st.write("给原神打 ", level,"分")

from fastai.vision.all import *
upload_img = st.file_uploader("Upload an image",
                               type=['jpg',
                                      'png'])

if upload_img is not None:
    img = PILImage.create(upload_img)
    st.image(img.to_thumb(256,256), 
             caption="Uploaded Image")

    
